Text:
@spastik64 
20mbps is the "Maximum Bitrate." It's VBR not CBR. The bitrate never gets that high. If it did, you certainly wouldn't have only a 5GB file. VBR(Variable Bitrate) means the bitrate changes according to what's being processed by the video. Faster scenes full of action require a higher bitrate than scenes that don't move, so to maintain quality it changes, where as CBR(Constant Bitrate) stays steady at one single bitrate throughout the whole video. 

@mentallyours
People may be limiting their upload speed, blocking it all together, or have bad upstream, so they can't provide as much as they take.

@noz666
Almost everything my cable provider broadcasts is in 60FPS. The bitrate is not that high either(Read reply to spastik64). I also don't encode. I cap. All I can do is limit the bitrate of the broadcast as it's being made into a transport stream file on my computer. Read the description to this file for the bitrate of the video.

@Rush
This user is correct. 60FPS is a lot to process, so weak computer systems will not be able to handle it properly. Sure, there may be ways to get it to work better though, if you know what you're doing. Look for an SD or HD copy later with half the framerate if your system cannot handle the quality and fluidity of my releases.

